- input: "TEXT\x1CC00432260\x1C.TEXT\x1C\x1CF24\x1COn 4/28/08 Club for Growth PAC
    began running radio ads opposing Doug Ose in the CA-4 primary which triggered
    a 48 hour independent expenditure report due today, 4/30/08.  This report was
    uploaded yesterday, 4/29/08; however, we inadvertantly left off a transaction
    from 4/2/08 and 4/9/08 that were in support of another candidate in the race,
    Tom McClintock.  The FEC file software will not allow us to amend the report that
    was due today, so we are filing this 48 Hour independent expenditure report as
    an amendment or replacement to the one filed on 4/29/08."
